import { AppBar, Toolbar } from '@mui/material';
import { Container } from '@mui/system';
import React from 'react'
import { Link } from 'react-router-dom';
import '../App.css'

const NavBar = () => {


    return (
        <>
        <AppBar color='transparent' position='static'>
            <Container >
                <Toolbar >
                    <img src='https://cdn1.storehippo.com/s/573db1519f0d58741f0cc5c1/ms.settings/5256837ccc4abf1d39000001/webp/589eeda381c872391b08f498-480x480.png' alt='logo' />
                </Toolbar>
            </Container>
        </AppBar>
        </>
    )
}

export default NavBar
